import React from "react";

function InputTable(props) {
  const { input1, setInput1, input2, setInput2, tableData } = props;

  const handleSubmit = (e) => {
    e.preventDefault();
    props.onSubmit({ input1, input2 });
    setInput1("");
    setInput2("");
  };

  return (
    <div style={{ textAlign: "center" }}>
      <form onSubmit={handleSubmit}>
        <label style={{ marginRight: "10px" }}>
          College:
        </label>
        <input type="text" value={input1} onChange={(e) => setInput1(e.target.value)} style={{ marginRight: "20px" }} />
        <label style={{ marginRight: "10px" }}>
          Major:
        </label>
        <input type="text" value={input2} onChange={(e) => setInput2(e.target.value)} style={{ marginRight: "20px" }} />
        <button type="submit" style={{ backgroundColor: "green", color: "white", border: "none", padding: "10px 20px", borderRadius: "50%", fontSize: "25px" }}>+</button>
      </form>
      <br />
      <table style={{ margin: "0 auto" }}>
        <thead>
          <tr>
            <th>College</th>
            <th>Major</th>
            <th>Salary</th>
          </tr>
        </thead>
        <tbody>
          {tableData.map((data, index) => (
            <tr key={index}>
              <td>{data.input1}</td>
              <td>{data.input2}</td>
              <td>{"Salary xxx"}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default InputTable;
